  `bayar_beras` float DEFAULT NULL,
  `bayar_uang` decimal(15,2) DEFAULT NULL,
  `confirmation_status` enum('pending','confirmed') NOT NULL DEFAULT 'pending',
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `status` enum('belum_valid','valid','distribusi') NOT NULL DEFAULT 'belum_valid',
  `validation_time` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

